import React from 'react'
import { Work, Wrapper } from '../Components/MyWork/MyWork.elements'
import { PageTitle } from '../GlobalStyles'

function MyWork() {
  return (
    <Work id="MyWork">
      
      <PageTitle>My Work</PageTitle>
    </Work>
  )
}

export default MyWork
